  def tagAndPrint( input: String ) {

    val values = input.split(",")
    var cellNumber = 1
    var counter = 0

    for (value <- values) {

      counter += 1
      if (counter % 10 == 0) println()

      println(s"Cell [$cellNumber] = [$value]")
      cellNumber += 1
    }
  }

  /** quick utility wrapper **/
  def isAllDigits(x: String) = x forall Character.isDigit
  def isDoubleable(s: String): Boolean = ( allCatch opt s.toDouble).isDefined

  /**
    * Assumes that both inputs are the same length
    * @param inputA
    * @param inputB
    */
  def tagAndPrintBoth( inputA: String, inputB: String, showHits: Boolean, showMisses: Boolean, showEquivalents: Boolean, showZeroAndBlanks: Boolean, max: Int ) {

    val valuesA = inputA.split(",")
    val valuesB = inputB.split(",")

    var cellNumber = 0
    var linesPrinted = 0
    var hits = 0
    var misses = 0
    var equivalents = 0
    var zerosAndBlanks = 0

    var a = ""
    var b = ""

    var mapId = 0
    var wibCode = ""
    val wibCodes = List( "36065", "36235", "36060", "36155", "36105", "36240", "36005", "36120", "36145", "36015", "36195", "36220", "36115", "36090", "36095", "36100", "36225", "36135", "36230", "36110", "36215", "36150", "36030", "36125", "36165", "36170", "36900", "36140", "36210", "36045", "36185", "36080", "99999", "36903", "36175", "36075" )
    var wibCodeRow = ""

    // iterate zipped lists
    breakable {

      for (value <- valuesA.zip(valuesB)) {

        // insert space every n printed lines
        //if ( linesPrinted % 10 == 0 ) println()

        // continue, or break?
        if (cellNumber > (max + 1)) {
          break
        }

        // build prefix(es?)
        wibCode = wibCodes( cellNumber / 434 )
        mapId = ( cellNumber % 434 ) + 1
        wibCodeRow = s"wibCode [$wibCode] mapId [$mapId] "
        cellNumber += 1

        a = value._1.trim
        b = value._2.trim

        if (a.equals(b)) {

          hits += 1
          if (showHits) {
            println( s"$wibCodeRow Cell [$cellNumber] [${a}] == [${b}] [true]")
            linesPrinted += 1
          }
        } else if ( a == "0" && b == "" ) {

          zerosAndBlanks += 1
          if ( showZeroAndBlanks ) {
            println(s"$wibCodeRow Cell [$cellNumber] [${a}] == [${b}] [false]")
            linesPrinted += 1
          }

        } else if (isDoubleable(a) && isDoubleable(b) && (a.toDouble == b.toDouble)) {

          equivalents += 1
          if ( showEquivalents ) {
            println(s"$wibCodeRow Cell [$cellNumber] [${a}] ~~ [${b}] [~true]")
            linesPrinted += 1
          }
        } else {

          misses += 1
          if (showMisses) {
            println(s"$wibCodeRow Cell [$cellNumber] [${a}] == [${b}] [false]")
            linesPrinted += 1
          }
        }
      }
    }
    println( s"\n\nHits: [$hits], misses: [$misses], equivalents: [$equivalents] and zerosAndBlanks [$zerosAndBlanks]" )
    val accuracy = ( ( hits * 1.0 ) / cellNumber ) * 100
    println( f"hits [$hits] / cells [$cellNumber] = accuracy: [$accuracy%.2f]%%" )

    // count zeros and commas in strings to be compared
    var zeros = inputA.count( _ == '0' )
    var commas = inputA.count( _ == ',' )
    //var empty = inputA.count( _ == '\0' )
    println( s"inputA zeros [$zeros] and commas [$commas]" )

    zeros = inputB.count( _ == '0' )
    commas = inputB.count( _ == ',' )
    //empty = inputB.count( _ == '\0' )
    println( s"inputB zeros [$zeros] and commas [$commas]" )
  }


